import React, {useEffect} from "react";
import {useUser} from "hook/User";
import styled from "styled-components";
import {useForm} from "react-hook-form";
import {useNavigate} from "react-router-dom";
import {cartDelete, cartUpdate, retrieveCart} from "../backend/cart";
import TableContainer from "@mui/material/TableContainer";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";
import TableBody from "@mui/material/TableBody";


const StyledDiv = styled.div`
  display: flex;
  flex-direction: column;
`

const StyledH1 = styled.h1`
`

const StyledInput = styled.input`
`

const StyledButton = styled.button`
`

function createData(
    name: string,
    calories: number,
    fat: number,
    carbs: number,
    protein: number,
) {
    return { name, calories, fat, carbs, protein };
}

const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const Cart = () => {
    const {accessToken} = useUser();

    // cart
    const [cart, setCart] = React.useState(0);
    const [total, setTotal] = React.useState(0);
    const navigate = useNavigate();

    const viewCart = () => {
        retrieveCart({}, accessToken)
            .then(response => {
                setCart(response.data.items)
                setTotal(response.data.total)
                console.log(response.data.items)
            })
            .catch(error => alert(JSON.stringify(error.response.data, null, 2)));
    }

    const backHome = () => {
        navigate("/");
        window.location.reload();
    }

    const updateCart = (event, movieId) => {
        const payload = event.target.value > 0 ? {
            movieId: movieId,
            quantity: event.target.value
        } : {
            movieId: movieId
        }

        event.target.value > 0
            ? cartUpdate(payload, accessToken)
                .catch(error => alert(JSON.stringify(error.response.data, null, 2)))
            : cartDelete(payload, accessToken)
                .catch(error => alert(JSON.stringify(error.response.data, null, 2)));

        window.location.reload();
    }

    const rows = [];

    useEffect(() => viewCart(), []);

    return (
        <StyledDiv>
            <TableContainer component={Paper}>
                <Table sx={{ maxWidth: 600 }} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>Overview</TableCell>
                            <TableCell>{movie.overview}</TableCell>
                        </TableRow>
                        <TableRow>
                            <TableCell>Director</TableCell>
                            <TableCell>{movie.director}</TableCell>
                        </TableRow>
                        <TableRow>
                            <TableCell>Rating</TableCell>
                            <TableCell>{movie.rating}/10</TableCell>
                        </TableRow>
                        <TableRow>
                            <TableCell>Budget</TableCell>
                            <TableCell>{movie.budget}</TableCell>
                        </TableRow>
                        <TableRow>
                            <TableCell>Revenue</TableCell>
                            <TableCell>{movie.revenue}</TableCell>
                        </TableRow>
                        <TableRow>
                            <TableCell>Genres</TableCell>
                        </TableRow>
                        <TableRow>
                            <TableCell>People</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {rows.map((row) => (
                            <TableRow
                                key={row.name}
                                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                            >
                                <TableCell component="th" scope="row">
                                    {row.name}
                                </TableCell>
                                <TableCell align="right">{row.calories}</TableCell>
                                <TableCell align="right">{row.fat}</TableCell>
                                <TableCell align="right">{row.carbs}</TableCell>
                                <TableCell align="right">{row.protein}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </StyledDiv>

    );
}

export default Cart;
